sys_variable_value.value:
(function execute(inputs, outputs) {

    var relPathStr = inputs.relPath;
    var relPathProjStr = inputs.relPathProj;
    var relPathGEStr = inputs.relPathGE;
    var relPathHVAStr = inputs.relPathHVA;

    var resultJSON = '';
    var createdJSON = new LaufwerkADDataObjectLoader();

    resultJSON = createdJSON.getLaufwerkPNewJSON(relPathStr, relPathProjStr, relPathGEStr, relPathHVAStr);

    //outputs.resjson = resultJSON.toString();
    outputs.resjson = JSON.stringify(resultJSON);


})(inputs, outputs);

